import styled from 'styled-components';
import { color } from '../../styles/styles';

export const Container = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  justify-content: center;

  background: ${color.lightest};
  height: 537px;
  width: 100%;

  h2 {
    font-size: 16px;
    font-weight: 700;
    margin: 0.5em 0;
    text-align: center;
  }
`;
